// Watchlist.js
import React from "react";

const Watchlist = () => {
  return (
    <div className="watchlist">
      <div className="header">
        <p className="">Watchlist</p>
        <i
          className="fa-solid fa-plus"
          id="new-btn"
          // onClick={() => setShowModal(true)}
        ></i>
      </div>
      <ul>
        <li>Stock 1</li>
        <li>Stock 2</li>
        <li>Stock 3</li>
      </ul>
    </div>
  );
};

export default Watchlist;
